{"query":"mutation CreditAccount {
	creditAccount(
		input: {
			providerId: "{{ _.providerId }}"
			accountId: "{{ _.accountId }}"
			amount: 1000
		}
	) {
		... on CreditAccountPayload {
			__typename
			account {
				balance {
					customData
					value
					version
				}
				customData
				id
			}
		}
		... on AccountNotFound {
			errorMessage
			accountId
			errorCode
			providerId
		}
		... on InvalidField {
			errorMessage
			errorCode
			fieldName
		}
	}
}
","operationName":"CreditAccount"}

{"query":"mutation CreateAccount {
	createAccount(
		input: { accountId: "{{ _.accountId }}", providerId: "{{ _.providerId }}" }
	) {
		... on InvalidField {
			errorMessage
			fieldName
			errorCode
		}
		... on AccountAlreadyExists {
			errorMessage
			errorCode
			accountId
		}
		... on AccountNotFound {
			errorMessage
			accountId
			errorCode
			providerId
		}
		... on CreateAccountPayload {
			__typename
			account {
				id
				providerId
			}
		}
	}
}
","operationName":"CreateAccount"}

{"query":"query GetAccount {
	getAccount(accountId: "{{ _.accountId }}", providerId: "{{ _.providerId }}") {
    ... on AccountNotFound {
      errorMessage
      providerId
      errorCode
      accountId
    }
    ... on Account {
      id
      customData
      providerId
      balance {
        customData
        value
        version
      }
			activePlanVersions{
				from
				to
				planVersion{
					id
					version
          planServices{
						balanceName
					}
				}
			}
			archivedPlanVersions{
				from
				to
				planVersion{
					id
					version
          planServices{
						balanceName
					}
				}
			}
		}
	}
}","operationName":"GetAccount"}

{"query":"query getEventDataRecordsByDevice {
	getEventDataRecordsByDevice(
		providerId: "{{ _.providerId }}",
		deviceId: "{{ _.deviceId }}",
		first: 100,
		filterBy: {
			types: [CHARGING, BILLING],
			from: "2022-06-29T17:28:00.000Z",
			to: "2022-08-01T00:00:00.000Z"
	})
{
			... on EventDataRecordDeviceConnection{
            edges{
                node{
                    customData
                    id
                }
                cursor
            }
            pageInfo{
            hasPreviousPage
            hasNextPage
            startCursor
            endCursor
            }
        }
        ... on DeviceNotFound{
            providerId
            deviceId
            errorCode
            errorMessage
        }
    }
}","operationName":"getEventDataRecordsByDevice"}

{"query":"query getEventDataRecordsByAccount {
