{"query":"query GetPlan {
	getPlan(
		planId: "{{ _.planId }}"
		providerId: "{{ _.providerId }}"
	) {
		... on PlanNotFound {
			errorMessage
			errorCode
			planId
			providerId
		}
		... on Plan {
			id
			name
			providerId
			versions(first: 10) {
				pageInfo {
					startCursor
					endCursor
				}
				edges {
					node {
						createdAt
						createdBy
						deployedAt
						deployedBy
						id
						modifiedAt
						modifiedBy
						priority
						refCount
						state
						version
						planServices {
							balanceName
							id
							name
							ratingGroupId
							providedFields {
								customData
								dataType
								name
							}
							ruleSets {
								charging {
									id
									name
									pluginId
								}
								crediting {
									id
									name
									pluginId
								}
								recurring {
									id
									name
									pluginId
								}
							}
						}
						counters {
							increment
							name
							notificationFields
							persistent
							selector
							period {
								data
								type
							}
							states {
								name
								threshold
							}
						}
					}
				}
			}
		}
	}
}
","operationName":"GetPlan"}

