{"query":"mutation DeletePlanVersion {
	deletePlanVersion(
		input: {
			providerId: "{{ _.providerId }}"
			planVersionId: "{{ _.versionId }}"
		}
	) {
		... on PlanVersionHasReferences {
			errorMessage
			errorCode
			planVersion {
				id
				version
				state
			}
		}
		... on PlanVersionNotFound {
			errorMessage
			providerId
			planVersionId
			errorCode
		}
		... on DeletePlanVersionPayload {
			__typename
			deletedPlanVersionId
			plan {
				providerId
				id
				name
				versions(first: 10) {
					edges {
						node {
							version
							state
							id
						}
					}
				}
			}
		}
	}
}
","operationName":"DeletePlanVersion"}

{"query":"mutation DeletePlan {
	deletePlan(
		input: { planId: "{{ _.planId }}", providerId: "{{ _.providerId }}" }
	) {
		... on PlanIsReadOnly {
			errorMessage
			providerId
			planId
			errorCode
		}
		... on PlanVersionHasReferences {
			errorMessage
			errorCode
			planVersion {
				id
				version
				providerId
			}
		}
		... on PlanNotFound {
			errorMessage
			providerId
			planId
			errorCode
		}
		... on DeletePlanPayload {
			__typename
			deletedPlanServices
			deletedPlanId
			deletedPlanVersions
		}
	}
}
","operationName":"DeletePlan"}

{"query":"mutation DeployPlan {
	deployPlan(
		input: {
			planVersionId: "{{ _.versionId }}"
			providerId: "{{ _.providerId }}"
		}
	) {
		... on PlanVersionWrongTransition {
			errorMessage
			providerId
			planVersionId
			errorCode
		}
		... on PlanVersionPayload {
			__typename
			planVersion {
				version
				state
				id
				planServices {
					balanceName
					id
					name
					ratingGroupId
				}
				plan {
					id
					name
				}
			}
		}
		... on MigrationAlreadyInProgress {
			errorMessage
			providerId
			planVersionId
			errorCode
		}
		... on DeploymentVerificationFailed {
			errorMessage
			planVersionId
			providerId
			errorCode
		}
		... on PlanVersionNotFound {
			errorMessage
			providerId
			planVersionId
			errorCode
		}
	}
}
","operationName":"DeployPlan"}

