{"query":"mutation SubscribeToPlan {
	subscribeToPlan(
		input: {
			accountId: "{{ _.accountId }}"
			providerId: "{{ _.providerId }}"
			planVersionId: "{{ _.versionId }}"
		}
	) {
    ... on SubscribeToPlanVersionValidationFailed {
      errorMessage
      errorCode
    }
    ... on InvalidField {
      errorMessage
      fieldName
      errorCode
    }
    ... on AccountNotFound {
      errorMessage
      providerId
      errorCode
      accountId
    }
    ... on PlanVersionIsNotAssignable {
      errorMessage
      providerId
      planVersionId
      errorCode
    }
    ... on PlanVersionNotFound {
      errorMessage
      planVersionId
      providerId
      errorCode
    }
    ... on SubscribeToPlanVersionPayload {
      __typename
      subscribedPlanVersion {
        to
        from
        planVersion {
          version
          state
          id
        }
      }
      account {
        customData
        id
        activePlanVersions {
          from
          to
          planVersion {
            version
            state
            id
          }
        }
        archivedPlanVersions {
          to
          from
          planVersion {
            version
            state
            id
          }
        }
        balance {
          version
          value
          customData
        }
        inactivePlanVersions {
          to
          planVersion {
            state
            version
            id
          }
          from
        }
      }
    }
  }
}
","operationName":"SubscribeToPlan"}

{"query":"mutation CancelPlanSubscription {
	cancelPlanSubscription(
		input: {
			accountId: "{{ _.accountId }}"
			providerId: "{{ _.providerId }}"
			planVersionId: "{{ _.versionId }}"
		}
	) {
		... on SubscriptionNotFound {
			from
			to
			planVersionId
			errorMessage
			errorCode
		}
		... on InvalidField {
			errorMessage
			fieldName
			errorCode
		}
		... on AccountNotFound {
			errorMessage
			providerId
			errorCode
			accountId
		}
		... on PlanVersionNotFound {
			providerId
			planVersionId
			errorMessage
			errorCode
		}
		... on CancelPlanVersionSubscriptionPayload {
			__typename
			account {
				providerId
				id
				customData
				activePlanVersions {
					to
					from
					planVersion {
						version
						state
						id
					}
				}
				archivedPlanVersions {
					to
					from
					planVersion {
						version
						state
						id
					}
				}
				inactivePlanVersions {
					to
					from
					planVersion {
						version
						state
						id
					}
				}
			}
		}
	}
}
","operationName":"CancelPlanSubscription"}

